    false,nt"url": null,nt"notes": "The project objectives were to assess potential
    salmon predation impact on juvenile salmon and herring by: (1) comparing diets of
    adult pink salmon during their homing migrations using samples taken from surface
    trawls in SEAK straits and purse seines in SEAK and PWS; (2) contrasting predation
    incidence of these abundant pink salmon with the less abundant, more piscivorous
    adult coho and immature (age-1+) Chinook salmon in SEAK straits; and (3) examining
    potential climate mechanisms that could influence predator-prey match-mismatch by
    altering life history patterns of growth, migrationntiming, or stock-specific characteristics.",nt"license_title":
